import React from "react";
// import { Parallax } from "react-scroll-parallax";
import { ContactContainer, Image } from "./ContactElements";
import Daruma from "../../images/Daruma.png";

const Contact = () => {
  return (
      <ContactContainer id="daruma">
        <Image src={Daruma} />
      </ContactContainer>
  );
};

export default Contact;
